import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <Header />
      <main className='main'>
        <h1>Hello World</h1>
      </main>
      <Footer />
    </div>
  );
}

export default App;
